import styled, { createGlobalStyle } from "styled-components";

const BackGround = styled.div`
  height: 100vh;
  width: 100vw;
  background: #ffeb3b;
  transform: rotate(170deg) skew(0deg);
  margin: -30px;
  position: fixed;
`;

const GlobalStyle = createGlobalStyle`
    *{
      margin: 0px;
      padding: 0px; 
      overflow: hidden;
    }
`;

function App() {
  return (
    <>
      <GlobalStyle />
      <BackGround></BackGround>
    </>
  );
}

export default App;
